import React from "react";
import BootstrapTable from "react-bootstrap-table-next";
import filterFactory, { textFilter } from "react-bootstrap-table2-filter";
import paginationFactory from 'react-bootstrap-table2-paginator';

import {Card} from "react-bootstrap"

const products = [
  {
    id: 1,
    name: "abhishek",
    email: "abcd@gmail.com",
  },
  {
    id: 2,
    name: "abhishek",
    email: "abcd@gmail.com",
  },
  {
    id: 3,
    name: "abhishek",
    email: "abcd@gmail.com",
  },
  {
    id: 4,
    name: "abhishek",
    email: "abcd@gmail.com",
  },
  {
    id: 5,
    name: "abhishek",
    email: "abcd@gmail.com",
  },
  { id: 6, name: "abhishek", email: "abcd@gmail.com" },
];

const columns = [
  {
    dataField: "SlNo",
    text: "#",
  },
  {
    dataField: "name",
    text: "Name",
    filter: textFilter(),
    sort:true
  },
  {
    dataField: "email",
    text: "Email",
    filter: textFilter(),
    sort:true
  },
  {
    dataField: "price",
    text: "Created At",
  },
  {
    dataField: "price",
    text: "Updated At",
  },
  {
    dataField: "price",
    text: "Action",
  },
];

function home() {
  const noData = (
    <div className="text-muted py-3 text-center"> Sorry No Data..</div>
  );

  return (
    <div className="container">
      <div className="row">
        <div className="col-md-12 p-5">
         <Card>
         <BootstrapTable
            keyField="id"
            data={products}
            columns={columns}
            noDataIndication={noData}
            filter={filterFactory()}
            pagination={ paginationFactory() }
          />
         </Card>
        </div>
      </div>
    </div>
  );
}

export default home;
